import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";

export default function Reviewchemotherapyorder() {
  const location = useLocation();
  const navigate = useNavigate();
  const [patientOrder, setPatientOrder] = useState(null);

  useEffect(() => {
    if (location.state && location.state.newRegimenDetails) {
      setPatientOrder(location.state.newRegimenDetails);
    }
  }, [location.state]);

  function handleBack() {
    navigate(-1);
  }

  function handleSubmit() {
    console.log(patientOrder);
  }

  return (
    <div>
      {patientOrder ? (
        <div>
          <h2>Review</h2>
          <p>{patientOrder.regimenName}</p>
          {/* Render other order details here */}
          <button onClick={handleBack}>Back</button>
          <button onClick={handleSubmit}>Submit</button>
        </div>
      ) : (
        <div>Loading...</div>
      )}
    </div>
  );
}
